  styleUrls: ['./vr-custom.component.css']
})
export class VrCustomComponent {
  headset: vrInfo = {
    id: 1,
    ipAdress: '10.0.0.1',
    port: "8001",
    name: 'VR1',
    isOnline: true
  };
}
